///////////
// Loop //
/////////

var mouse = false;
document.addEventListener("mousedown", function () {
    mouse = true;
});

document.addEventListener("mouseup", function () {
    mouse = false;
});

var loop = new Afloop(function (delta) {

    if (Keyb.isDown("W") || Keyb.isDown("<up>")) {
        me.position.y -= me.speed * delta;
        if (me.position.y < HEIGHT / 2) {
            me.position.y = HEIGHT / 2;
        }
        me.isMoving = true;
        me.sync();
    }
    if (Keyb.isDown("S") || Keyb.isDown("<down>")) {
        me.position.y += me.speed * delta;
        if (me.position.y > HEIGHT - 64) {
            me.position.y = HEIGHT - 64;
        }
        me.isMoving = true;
        me.sync();
    }
    if (Keyb.isDown("A") || Keyb.isDown("<left>")) {
        me.position.x -= me.speed * delta;
        me.direction = -1;
        if (me.position.x < 0) {
            me.position.x = 0;
        }
        me.isMoving = true;
        me.sync();
    }
    if (Keyb.isDown("D") || Keyb.isDown("<right>") || mouse) {
        me.position.x += me.speed * delta;
        me.direction = +1;
        if (me.position.x > WIDTH) {
            me.position.x = WIDTH;
        }
        if (me.position.x >= truck.position.x) {
            me.position.x = truck.position.x + truck.getPushback();
        }
        me.isMoving = true;
        me.sync();
    }

    game.children.forEach(function (child) {
        if (child.update instanceof Function) {
            child.update(delta);
        }
    });

    game.children.sort(function (a, b) {
        if (a instanceof Person && b instanceof Person) {
            return a.position.y >= b.position.y;
        }
        return 0;
    });

    Pixi.render(game);

    if (truck.isDefeated) {
        document.getElementById("youve-yet-won").style.display = "none";
        document.getElementById("you-win").style.display = "block";
    } else {
        document.getElementById("youve-yet-won").style.display = "block";
        document.getElementById("you-win").style.display = "none";
    }

    var count = 0;
    for (var key in game.persons) {
        var person = game.persons[key];
        if (truck.position.x - person.position.x < 16) {
            count += 1;
        }
    }
    document.getElementById("players-playing").innerHTML = "People Pushing: " + count + "/" + PEOPLE_NEEDED;
});

